description:
Pixar Short Films Collection Volume 2 (2012) DivX BDrip ENG-ITA (12 Shorts + 7 Extras)



Compilation of the Pixar short animated films. It features 12 shorts that were released from 2007 through 2012 and it includes some student films from Pixar's directors as a bonus feature.


Genre:  Animation | Short
Audio: English, Italian
Subtitles: English, Italian



TRACKLIST:

01 - Your friend The Rat (2007)
02 - Presto (2008)
03 - BURN-E (2008)
04 - Partly Cloudy (2009)
05 - Dug's Special Mission (2009)
06 - George And A. J. (2009)
07 - Day &amp; Night (2010) 
08 - La Luna (2011)
09 - Hawaiian Vacation (2011)
10 - Air Mater (2011)
11 - Small Fry (2011)
12 - Time Travel Mater (2012)



